async function displayModal() {
  const modal = document.createElement("dialog");
  modal.style =
    "background-color: var(--variable-shim-primary-background);font-size: 14px;margin: 0;cursor: initial;display: block;position: absolute;top: 24px;left: 350px;border-radius: 3px;border: 1px solid var(--variable-shim-secondary);box-shadow: var(--variable-shim-pop-shadow);z-index: 1000;width: 600px;padding: 0;-webkit-overflow-scrolling: touch;overflow-y: auto;max-height: calc(88vh - 45px);";
  modal.setAttribute("id", "gdModal");
  const section = document.createElement("section");
  section.classList.add("actions");
  section.style += "padding: 20px !important; margin: 20px !important";
  const buttons = document.createElement("div");
  buttons.classList.add("button-wrap");
  const button = document.createElement("button");
  button.classList.add("button");
  button.textContent = "Close";
  button.addEventListener("click", closeModal);
  buttons.appendChild(button);

  const input = document.createElement("select");
  input.addEventListener("change", selectTheme);
  input.setAttribute("id", "select");
  input.style =
    "background-color: var(--variable-shim-primary-background);color: #fff;border-radius: 5px;border: 2px solid var(--variable-shim-primary);padding-top: 4px;padding-bottom: 3px;margin-bottom: 6px;margin-top: 3px;padding-right: 3px;padding-left: 4px;";
  for (i in themeData) {
    const option = await document.createElement("option");
    option.id = themeData[i].theme;
    option.text = themeData[i].theme;
    option.style =
      "background-color: var(--variable-shim-primary-background);color: #fff;border: 2px solid var(--variable-shim-primary);padding-top: 2px;padding-bottom: 1px;";
    await input.add(option);
  }
  if (await JSON.parse(window.localStorage.getItem("gd-style"))) {
    const z = await JSON.parse(window.localStorage.getItem("gd-style"));
    input.value = z.theme;
  }
  section.appendChild(input);
  section.appendChild(buttons);
  modal.appendChild(section);
  document.getElementById("application").appendChild(modal);
}
async function closeModal() {
  const modal = document.getElementById("gdModal");
  modal.remove();
}

window.onload = async function() {
  const body = document.body;
  const gdstyle = await document.createElement("style");
  gdstyle.setAttribute("id", "gd-style");

  const CodeMirrorStyleDefaults = await document.createElement("style");
  CodeMirrorStyleDefaults.setAttribute("id", "CodeMirrorStyleDefaults");
  CodeMirrorStyleDefaults.innerHTML =
    ".CodeMirror-linenumber{padding:0 3px 0 5px!important;min-width:20px!important;text-align:right!important;white-space:nowrap!important;font-size:13px!important}.CodeMirror-linenumber{-moz-box-sizing:content-box!important;box-sizing:content-box!important}.theme-cosmos,.theme-sugar{--variable-shim-matching-bracket-highlight:transparent !important;}";
  body.appendChild(CodeMirrorStyleDefaults);
  if (!(await JSON.parse(window.localStorage.getItem("gd-style")))) {
    await window.localStorage.setItem("gd-style", JSON.stringify(themeData[0]));
    gdstyle.innerHTML = themeData[0].css;
    body.appendChild(gdstyle);
  } else {
    if (
      (await JSON.parse(window.localStorage.getItem("gd-style"))) !== undefined
    ) {
      const style = await JSON.parse(window.localStorage.getItem("gd-style"));
      for (i in themeData) {
        if (themeData[i].theme === style.theme) {
          gdstyle.innerHTML = themeData[i].css;
        }
      }
      body.appendChild(gdstyle);
    } else {
      await window.localStorage.removeItem("gd-style");
      await window.localStorage.setItem(
        "gd-style",
        JSON.stringify(themeData[0])
      );
      gdstyle.innerHTML = themeData[0].css;
      body.appendChild(gdstyle);
    }
  }

  const before = document.getElementById("header-project");
  const container = document.createElement("div");
  const settings = document.createElement("button");
  container.classList.add("show-app-wrapper");
  settings.textContent = "Editor Settings";
  settings.setAttribute("onclick", "displayModal");
  settings.addEventListener("click", displayModal);
  const a = "show-app icon nav-item no-button-styles opens-pop-over".split(" ");
  for (i in a) {
    settings.classList.add(a[i]);
  }
  container.appendChild(settings);
  before.insertAdjacentElement("afterend", container);
};

async function selectTheme() {
  var theme = await document.getElementById("select").value;
  for (i in themeData) {
    if (themeData[i].theme === theme) {
      await window.localStorage.setItem(
        "gd-style",
        JSON.stringify(themeData[i])
      );
      const styler = document.getElementById("gd-style");
      styler.innerHTML = themeData[i].css;
    }
  }
}
